import './App.css';
import HomeScreen from "./HomeScreen";
import {BrowserRouter, Route} from "react-router-dom";

function App() {
  return (
    <div className="container-fluid">
        <BrowserRouter>
            <Route path="/" element={HomeScreen}>
            </Route>

        </BrowserRouter>
    </div>
  );
}

export default App;
